pragma solidity ^ 0.4.25;

//#################################################################
//#################################################################
//       ENUMS, HELPERS, TOKEN, OWNED, BLABLA...
//#################################################################
//#################################################################

//#################################################################
//WildaloERC721.sol
//#################################################################

contract IBasicToken {
    modifier onlyPayloadSize(uint size) {_;}

    function transfer(address _to, uint _value) public onlyPayloadSize(2 * 32);
    function balanceOf(address _owner) public constant returns (uint balance);

    event Transfer(address from, address to, uint value);
}

contract IStandardToken is IBasicToken {

    function tokenURI() external view returns (string);
    function transferFrom(address _from, address _to, uint _value) public onlyPayloadSize(3 * 32);
    function approve(address _spender, uint _value) public onlyPayloadSize(2 * 32);
    function allowance(address _owner, address _spender) public constant returns (uint remaining);

    event Approval(address indexed owner, address indexed spender, uint value);
}

contract ERC721Basic {
    event Transfer(address indexed from, address indexed to, uint256 tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 tokenId);
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);

    function tokenURI(uint256 _tokenId) external view returns(string);

    function balanceOf(address _owner) public view returns (uint256 _balance);
    function ownerOf(uint256 _tokenId) public view returns (address _owner);
    function exists(uint256 _tokenId) public view returns (bool _exists);

    function approve(address _to, uint256 _tokenId) public;
    function getApproved(uint256 _tokenId) public view returns (address _operator);

    function setApprovalForAll(address _operator, bool _approved) public;
    function isApprovedForAll(address _owner, address _operator) public view returns (bool);

    function transferFrom(address _from, address _to, uint256 _tokenId) public;
    function safeTransferFrom(address _from, address _to, uint256 _tokenId) public;
    function safeTransferFrom(
    address _from,
    address _to,
    uint256 _tokenId,
    bytes _data
    )
    public;
}

contract IERC721Receiver {
    function onERC721Received(
        address _from,
        uint256 _tokenId,
        bytes _data
    ) public returns (bytes4);
}

//#################################################################
//Enums.sol
//#################################################################
contract IUsingEnums {}

//#################################################################
//Helpers.sol
//#################################################################
contract IOwned {

    event OwnershipTransferred(address indexed from, address indexed to);
    modifier __onlyOwner {_;}

    function transferOwnership(address _newOwner) __onlyOwner public;
    function acceptOwnership() public;
}

contract IHasAdminController is IOwned {
    modifier __onlyAdmin {_;}

    function setAdminAddress(address _adminAddress) __onlyOwner public;
}

contract IUsingWildaloERC721 is IOwned {
    function setWildaloERC721Contract(address _address) __onlyOwner public;
}

contract IUsingSettings is IOwned {

    modifier __notPaused {_;}
    modifier __onlySystemUser {_;}

    function setSettingsContract(address _address) __onlyOwner public;
}

contract IUsingCardBase is IOwned {
    function setCardBaseContract(address _address) __onlyOwner public;
}

contract IUsingCard is IOwned {
    function setCardContract(address _address) __onlyOwner public;
}

contract IUsingCardPackage is IOwned {
    function setCardPackageContract(address _address) __onlyOwner public;
}

contract IUsingAuction is IOwned {
    function setAuctionContract(address _address) __onlyOwner public;
}

contract IUsingRepository is IOwned {
    function setRepositoryContract(address _address) __onlyOwner public;
}

contract IShared is IOwned {
 
    modifier __onlyShared {_;}

    function setSharingWith(address _address, bool _isShared, bool _linked) __onlyOwner public;
    function isSharedWith(address _address) public view returns(bool);

    //Sadece ilgili contract'a bagli ve degistirilemez.
    function isLinked() public view returns(bool);
}


contract ISharedUint256 is IShared {

    function get(uint256 _id) public view returns(uint256);
    function set(uint256 _id, uint256 _data) __onlyShared public;

    function get(uint256 _targetData, uint256 _id) public view returns(uint256);
    function set(uint256 _targetData, uint256 _id, uint256 _data) __onlyShared public;
}

contract ISharedUint256ByAddress is IShared {

    function get(address _address) public view returns(uint256);
    function set(address _address, uint256 _data) __onlyShared public;

    function get(uint256 _targetData, address _address) public view returns(uint256);
    function set(uint256 _targetData, address _address, uint256 _data) __onlyShared public;
}

contract ISharedArrayUint256 is IShared {

    function get(uint256 _index) public view returns(uint256);
    function set(uint256 _index, uint256 _data) __onlyShared public;

    function get(uint256 _targetData, uint256 _index) public view returns(uint256);
    function set(uint256 _targetData, uint256 _index, uint256 _data) __onlyShared public;

    function push(uint256 _data) __onlyShared public;
    function push(uint256 _targetData, uint256 _data) __onlyShared public;

    function getLength() public view returns(uint256);
    function getLength(uint256 _targetData) public view returns(uint256);
}


//#################################################################
//       SHARED
//#################################################################

contract ICardBases is ISharedArrayUint256 {

}

contract ICards is ISharedUint256 {

}

contract IRarityIndexs is ISharedArrayUint256 {

}

//###################################################
//              ADMIN CONTRACTS 
//###################################################

contract IAdmin is IShared,
    IUsingSettings,
    IUsingEnums { 

    //minter
    function getSystemUser() public view returns(address);
    function setSystemUser(address _systemUser) __onlyOwner public;

    //paused
    function getPaused() public view returns(bool);
    function setPaused(bool _paused) __onlyOwner public;

    //bidDiscountPercent
    function getBidDiscountPercent() public view returns(uint256);
    function setBidDiscountPercent(uint256 _bidDiscountPercent) __onlyOwner public;

    //fodrDiscountPercent
    //not: suan kullanilmiyor...
    function getFodrDiscountPercent() public view returns(uint256);
    function setFodrDiscountPercent(uint256 _fodrDiscountPercent) __onlyOwner public;

    //fodrBurningCountOnUpdate
    function getFodrBurningCountOnUpdate() public view returns(uint256);
    function setFodrBurningCountOnUpdate(uint256 _fodrBurningCountOnUpdate) __onlyOwner public;

    //packagePrices
    function getPackagePrice(uint256 _packageType) public view returns(uint256);
    function setPackagePrice(uint256 _packageType, uint256 _packagePrice) __onlyOwner public;

    //priceCurrencyMultiplier
    function getPriceCurrencyMultiplier(uint256 _currencyType) public view returns(uint256);
    function setPriceCurrencyMultiplier(uint256 _currencyType, uint256 _priceCurrencyMultiplier) __onlyOwner public;
}


contract ISettings is IHasAdminController {

    //systemUser
    function getSystemUser() public view returns(address);
    function setSystemUser(address _systemUser) __onlyAdmin public;

    //paused
    function getPaused() public view returns(bool);
    function setPaused(bool _paused) __onlyAdmin public;

    //bidDiscountPercent
    function getBidDiscountPercent() public view returns(uint256);
    function setBidDiscountPercent(uint256 _bidDiscountPercent) __onlyAdmin public;

    //fodrDiscountPercent
    function getFodrDiscountPercent() public view returns(uint256);
    function setFodrDiscountPercent(uint256 _fodrDiscountPercent) __onlyAdmin public;

    //fodrBurningCountOnUpdate
    function getFodrBurningCountOnUpdate() public view returns(uint256);
    function setFodrBurningCountOnUpdate(uint256 _fodrBurningCountOnUpdate) __onlyAdmin public;

    //packagePrices
    function getPackagePrice(uint256 _packageType) public view returns(uint256);
    function setPackagePrice(uint256 _packageType, uint256 _packagePrice) __onlyAdmin public;

    //priceCurrencyMultiplier
    function getPriceCurrencyMultiplier(uint256 _currencyType) public view returns(uint256);
    function setPriceCurrencyMultiplier(uint256 _currencyType, uint256 _priceCurrencyMultiplier) __onlyAdmin public;

}


//###################################################
//###################################################
// O T H E R    C O N T R A C T S 
//###################################################
//###################################################

contract IWildaloERC721 is ERC721Basic, IShared {

    event Mint(address indexed to, uint256 tokenId);
    event Burn(uint256 tokenId);

    function name() public view returns (string);
    function symbol() public view returns (string);
    function setTokenURI(string _tokenURI) __onlyOwner public returns (string);
    function tokenOfOwnerByIndex(address _owner, uint256 _index) public view returns (uint256);
    function totalSupply() public view returns (uint256);
    function tokenByIndex(uint256 _index) public view returns (uint256);

    function mint(address _to, uint256 _tokenId) public __onlyShared; 

}

contract IFodr is IStandardToken, IShared {

    function setTokenURI(string _tokenURI) __onlyOwner public returns (string);

    function mint(address _to, uint _amount) __onlyShared onlyPayloadSize(2*32) public;

    function burn(address _from, uint _amount) __onlyShared onlyPayloadSize(2*32) public;
}

contract IWarc is IStandardToken, IShared {

    function setTokenURI(string _tokenURI) __onlyOwner public returns (string);

}

contract ICardBase is IShared,
    IUsingSettings,
    IUsingEnums {

    function setProbs(
        address _cardBasesAddress,
        address _rarityIndexs
        ) public __onlyOwner;

    function initCardBase() public __onlyOwner;

    // usuable id between 1 to (n-1)
    function existCardBase(uint256 _baseId) __onlyShared public view returns(bool);

    // usuable id between 1 to (n-1)
    function getMetadataFromBaseId(uint256 _baseId) __onlyShared public view returns(uint256);

    //note:passives must be <= 30
    function createCardBase(uint256 _metedata) __onlyShared public;

    function randomToBaseIdByRarity(uint256 _random, uint256 _rarity) __onlyShared public view returns (uint256);
    //bir secenek: yendigin rakibin puanina gore al?(search alg degisirse.)
    function randomBaseIdToWinner(address _to, int256 _score, uint256 _count ) public returns (uint256);

}

contract ICard is IShared,
    IUsingCardBase,
    IUsingWildaloERC721,
    IUsingSettings,
    IUsingEnums {
    
    function setProbs(
        address _cardsAddress
        ) public __onlyOwner;

    function mintCardWithBaseId(address _to, uint256 _baseId) __onlyShared public returns(uint256, uint256);
    function upgradeCard(uint256 _cardId, uint256 _burnedCardId) __onlyShared public returns(uint256);
    function getCardInfo(uint256 _cardId) public view returns(uint256);
}
 
contract ICardPackage is IShared,
    IUsingCardBase,
    IUsingCard,
    IUsingSettings,
    IUsingEnums
{
    event MintedPackageCard(address indexed to, uint256 packageId, uint256 cardId, uint256 metadata);

    function getPrice(uint256 _packageType, uint256 _currencyType) public view returns(uint256);
    
    function createPackage(address _to, uint256 _packageType, uint256 _currencyType) public __onlyShared returns (uint256 price, uint256 packageId);
}

contract IAuction is IShared,
    IUsingWildaloERC721,
    IERC721Receiver,
    IUsingSettings,
    IUsingEnums {

    function getAuctionInfo(uint256 _cardId) public view
        returns (address, uint256, uint256, uint256, uint256, uint256);

    function getOwnerOfAuctionFromCardId(uint256 _cardId) public view returns (address);

    //note: bu metodun cagrildigi yerde cagiran approve yapmali
    function createAuction(
        address _owner,
        uint256 _currency,
        uint256 _cardId,
        uint256 _startPrice,
        uint256 _endPrice,
        uint256 _duration
    ) __onlyShared public;
    function cancelAuction(address _owner, uint256 _cardId) __onlyShared public;
    function bid(address _bidder, uint256 _cardId) __onlyShared public;
    function getAuctionInfoForBid(uint256 _cardId) 
        public view
        returns (address, uint256, uint256);
}


contract IRepository is IShared,
    IUsingEnums, 
    IUsingSettings {
    
    function initialize(address _fodrAddress, address _warcAddress) public __onlyOwner;

    function getBalance(uint256 _currency) public view returns(uint256);
    function getTokenBalanceOf(address _to, uint256 _currency) public view returns(uint256);
    function getTokenAllowance(address _owner, uint256 _currency) public view returns(uint256);
    
    function isExistsCurrency(uint256 _currency) public view returns(bool);

    function withdrawAvax(address _to, uint256 _amount) __onlyShared public;
    function withdrawToken(address _to, uint256 _currency, uint256 _amount) __onlyShared public;

    function depositToken(address _from, uint256 _currency, uint256 _amount) __onlyShared public;
    function transferFrom(address _from, address _to, uint256 _currency, uint256 _amount) __onlyShared public;

    function mintFodr(address _to, uint256 _amount) __onlyShared public;
    function burnFodr(address _from, uint256 _amount) __onlyShared public;

    function() external payable {}    
}

contract IWildalo is IWildaloERC721,
    IUsingAuction,
    IUsingCardPackage,
    IUsingCardBase,
    IUsingCard,
    IUsingRepository,
    IUsingSettings,
    IUsingEnums {

    event MintFodr(address indexed to, uint256 amount);
    event TransferFunds(address indexed to, uint256 requestId, uint256 amount, uint256 currency);
    event CreateCardBase(uint256 metedata);
    event MintCardWithBaseId(address indexed to, uint256 cardId, uint256 metadata);

    event UpgradeCard(address indexed to, uint256 cardId, uint256 burnedCardId, uint256 metadata);
    event BuyPackage(address indexed to, uint256 packageId, uint256 packageType, uint256 currency, uint256 price);
    event CreatAuction(address indexed to, uint256 currency, uint256 cardId, uint256 startPrice, uint256 endPrice, uint256 duration);
    event CancelAuction(address indexed to, uint256 cardId);
    event Bid(address indexed from, address indexed to, uint256 cardId, uint256 biddedAmount, uint256 currency);

    function mintFodr(address _to, uint _amount) __onlySystemUser public;
    function transferFunds(address _to, uint256 _requestId, uint _amount, uint256 _currency) __onlySystemUser public;

    function createCardBase(uint256 _metedata) __onlySystemUser public;
    function mintCardWithBaseId(address _to, uint256 _baseId) __onlySystemUser public;

    function upgradeCard(uint256 _cardId, uint256 _burnedCardId) __notPaused public;

    function getPackagePrice(uint256 _packageType, uint256 _currencyType) public view returns(uint256);
    function buyPackage(uint256 _packageType, uint256 _currency) __notPaused public payable;

    function createAuction(uint256 _currency, uint256 _cardId, uint256 _startPrice, uint256 _endPrice, uint256 _duration) __notPaused public;
    function cancelAuction(uint256 _cardId) __notPaused public;
    function bid(uint256 _cardId) __notPaused public payable;

    function getTokenAllowance(uint256 _currency) public view returns(uint256);
    function getCardInfo(uint256 _cardId) public view returns(uint256);
}
